const _hoisted_11 = /* @__PURE__ */ createStaticVNode('<h2 id="best-practices" tabindex="-1">Best practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to &quot;Best practices&quot;">​</a></h2><h3 id="buttons-versus-links" tabindex="-1">Buttons versus links <a class="header-anchor" href="#buttons-versus-links" aria-label="Permalink to &quot;Buttons versus links&quot;">​</a></h3><p>Links are used primarily for navigation, and usually appear within or directly following a sentence.</p><p>Buttons are used primarily for actions, such as “Add”, “Close”, “Cancel”, or “Save”. Plain buttons, which look similar to links, are used for less important or less commonly used actions, such as “view shipping settings”.</p><p>The HTML that renders for the <code>Button</code> and <code>Link</code> components carries meaning. Using these components intentionally and consistently results in:</p><ul><li>a more inclusive experience for assistive technology users</li><li>a more cohesive visual experience for sighted users</li><li>products that are easier to maintain at scale</li></ul><h3 id="open-a-new-tab-only-when-necessary" tabindex="-1">Open a new tab only when necessary <a class="header-anchor" href="#open-a-new-tab-only-when-necessary" aria-label="Permalink to &quot;Open a new tab only when necessary&quot;">​</a></h3><p>Use default links whenever possible to avoid disorienting merchants and causing accessibility problems by opening a new tab.</p><p>External links should be used when merchants are:</p><ul><li>Performing a task or workflow, like creating a product</li><li>Navigating to a page outside of the Shopify admin</li></ul><h3 id="no-icon" tabindex="-1">No icon <a class="header-anchor" href="#no-icon" aria-label="Permalink to &quot;No icon&quot;">​</a></h3><p>Avoid using the <a href="https://polaris.shopify.com/icons?icon=ExternalIcon&amp;q=external" target="_blank" rel="noreferrer">external icon</a>, as it can add unnecessary visual load inside a sentence or when accompanied by other content. Instead, add clarity to external links through clear link text and predictable placement of the link in a merchant’s workflow.</p><p>Edge cases: External icons should not be used to indicate a new tab or window is being opened. However, they may be used sparingly in features where symbols help merchants scan and pick from a list of several kinds of navigation options, like the admin&#39;s global search results.</p>', 13);
